import React from 'react';
import Select from 'react-select'


const ColumnInput=({onName})=>{
    let columnNames =[]
    console.log(columnNames);
    for(let i =0;i<onName.length; i++){
        let obj = {value:onName[i], label:onName[i]};
        columnNames.push(obj);
    }
    console.log(columnNames);


    return(
        <Select options ={onName} />
    )
    
}

export default ColumnInput;
